function buildexpr(expr, wrong_expr) {
//parses 'expr' and makes pseudo-expression string  
var texpr = expr;
var pos_expr=0;
var len_expr;
var cur_subexpr = "";
var cur_char;
var out_expr = "log_expr = ";
var lcase = 0;
var expr_break = 0;

texpr = replaceSubstring(texpr,"  "," ");
texpr = replaceSubstring(texpr,"+ ","+");
texpr = replaceSubstring(texpr," +","+");
texpr = replaceSubstring(texpr,"++","+");

len_expr = texpr.length;
while (pos_expr <= len_expr-1)
   {
   cur_char = texpr.charAt(pos_expr);
   expr_break = 0;
   if ((cur_char == " ") || (cur_char == "+"))
      {
      expr_break = 1; 
      if (lcase == 1)
         {
         if (cur_subexpr != "") 
            {
            out_expr = out_expr +  "(si.indexOf('" + cur_subexpr + "',0) >= 0)"; 
            }
         else
            {
            out_expr = out_expr +  wrong_expr;
            }
         }
      else
         {
         if (cur_subexpr != "") 
            {
            out_expr = out_expr +  "(si.toUpperCase().indexOf('" + UC(cur_subexpr) + "',0) >= 0)";
            }
         else
            {
            out_expr = out_expr +  wrong_expr;
            }
         }
      if ((cur_char == " ") && (cur_subexpr != ""))
         {
         out_expr = out_expr + " || ";
         }
      if ((cur_char == "+") && (cur_subexpr != ""))
         {
         out_expr = out_expr + " && ";
         }
      lcase = 0;
      cur_subexpr = "";
      }
   else
      {
      if (cur_char == "!")
         {
         lcase = 1;
         }
      else
         {
         if (expr_break == 0)
            {
            cur_subexpr = cur_subexpr + cur_char;
            }
         }
      }
   pos_expr++;
   }
if (lcase == 1) 
   {
   if (cur_subexpr != "")
      {
      out_expr = out_expr +  "(si.indexOf('" + cur_subexpr + "',0) >= 0)";
      }
   else
      {
      out_expr = out_expr +  wrong_expr;
      }
   }
else
   {
   if (cur_subexpr != "")
      {
      out_expr = out_expr +  "(si.toUpperCase().indexOf('" + UC(cur_subexpr) + "',0) >= 0)";
      }
   else
      {
      out_expr = out_expr +  wrong_expr;
      }
   }

return(out_expr + ";");
}

function UC(str)
{
//uppercases a string
var strup = str;
strup = strup.toUpperCase();
return(strup);
}

function replaceSubstring(inputString, fromString, toString)
{
//replaces a substring with another one
var temp = inputString;
if (fromString == "")
   {
   return inputString;
   }
if (toString.indexOf(fromString) == -1)
   {
   while (temp.indexOf(fromString) != -1)
      {
      var toTheLeft = temp.substring(0, temp.indexOf(fromString));
      var toTheRight = temp.substring(temp.indexOf(fromString)+fromString.length, temp.length);
      temp = toTheLeft + toString + toTheRight;
      }
   }
else
   {
   var midStrings = new Array("~", "`", "_", "^", "#");
   var midStringLen = 1;
   var midString = "";
   while (midString == "")
      {
      for (var i=0; i < midStrings.length; i++)
         {
         var tempMidString = "";
         for (var j=0; j < midStringLen; j++) 
            {
            tempMidString += midStrings[i];
            }
         if (fromString.indexOf(tempMidString) == -1)
            {
            midString = tempMidString;
            i = midStrings.length + 1;
            }
         }
      }
   while (temp.indexOf(fromString) != -1)
      {
      var toTheLeft = temp.substring(0, temp.indexOf(fromString));
      var toTheRight = temp.substring(temp.indexOf(fromString)+fromString.length, temp.length);
      temp = toTheLeft + midString + toTheRight;
      }
   while (temp.indexOf(midString) != -1)
      {
      var toTheLeft = temp.substring(0, temp.indexOf(midString));
      var toTheRight = temp.substring(temp.indexOf(midString)+midString.length, temp.length);
      temp = toTheLeft + toString + toTheRight;
      }
   }
return temp;
}

function trim(inputString) 
{
//removes spaces from the head and tail of the string
if (typeof inputString != "string")
   {
   return inputString;
   }
var retValue = inputString;
var ch = retValue.substring(0, 1);
while (ch == " ")
   {
   retValue = retValue.substring(1, retValue.length);
   ch = retValue.substring(0, 1);
   }
ch = retValue.substring(retValue.length-1, retValue.length);
while (ch == " ") 
   {
   retValue = retValue.substring(0, retValue.length-1);
   ch = retValue.substring(retValue.length-1, retValue.length);
   }
while (retValue.indexOf("  ") != -1)
   {
   retValue = retValue.substring(0, retValue.indexOf("  ")) + retValue.substring(retValue.indexOf("  ") + 1, retValue.length);
   }
return retValue;
}